import React, { Component } from 'react';
import inkstain from './inkstain.svg';
import './App.css';
import './Landing.css'
import { Container, Row, Col } from 'reactstrap';

class Landing extends Component {
  render() {
    return (
<body>
<br></br>
<br></br>
<br></br><br></br>
<br></br><br></br>
<br></br><br></br>
<br></br><br></br>
<br></br><br></br>
<br></br><br></br>
<br></br><br></br>
<br></br><br></br>
<br></br><br></br>
</body>
    );
  }
}

export default Landing;
